import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      // slidesToShow: 1,
      // slidesToScroll: 1
    };
    return (
      <div style={{maxWidth:"700px",marginLeft:"200px",maxHeight:'700px'}}>
        <Slider {...settings}>
          <div>
           <img src='https://medex.am/_mx/uploads/topics/images/headache-medication.jpg?h=203&w=370' style={{maxWidth:'600px',maxHeight:'600px'}}/>
            <button>1</button>
          </div>
          <div>
          <img src='https://cdn.shopify.com/s/files/1/1600/4387/products/1-DVL-hero.png?v=1573838539' style={{maxWidth:'600px',maxHeight:'600px'}}/>
          <button>1</button>
          </div>
          <div>
          <img src='https://i3.imgbb.ru/img8/2/d/a/2daef2b3448b29891f9875fbcb814095.jpg' style={{maxWidth:'600px',maxHeight:'600px'}}/>
          <button>1</button>
          </div>
        </Slider>
      </div>
    );
  }
}
